## Objetivos generales

1) Diagónstico respecto de las estadísticas (institucional, técnico, información, metodología, etc.)

2) Capacitaciones en materia de estadísticas básicas e indicadores asociados


---

# Indicadores básicos de turismo &lt;br&gt;provinciales (IBTP)
## Objetivos específicos

1) Relevar información existente

2) Describir "gap de información"

3) Caracterizar RRHH e institucionales existentes

4) Capacitación para apropiación del conocimiento

---

1.	Informe N°1: Plan de Trabajo

2.	Informe N°2: Resultado de la Recolección de Información

3.	Informe N°3: Sistematización y Diagnóstico

4.	Informe N°4: Informe Final

# Indicadores básicos de turismo &lt;br&gt;provinciales (IBTP)

## Cuenta Satélite de turismo


_Es la herramienta recomendada por la Organización Mundial del Turismo, y reconocida por la comunidad internacional, para evaluar la importancia económica del turismo, conocer las industrias que se benefician de la llegada de visitantes, cuantificar el valor agregado directo que se genera al satisfacer la demanda turística y la generación de empleo, entre otros._
